co` AS `banco`,`mr`.`localidad` AS `localidad`,`mr`.`esquema_viaticos` AS `esquema_viaticos`,`mpr`.`id` AS `movimiento_proyecto_id`,`mpr`.`cliente` AS `cliente`,`mpr`.`servicio` AS `servicio`,`mpr`.`region` AS `region`,`mpr`.`tecnologia` AS `tecnologia`,`mpr`.`grupo` AS `grupo`,concat_ws('-',`mpr`.`cliente`,`mpr`.`servicio`,`mpr`.`region`,`mpr`.`tecnologia`,`mpr`.`grupo`) AS `proyecto`,concat_ws('-',`mpr`.`cliente`,`mpr`.`servicio`) AS `pd`,`mpr`.`tipo_proyecto` AS `tipo_proyecto`,`mc`.`id` AS `movimiento_coordinador_id`,`mc`.`coordinador_id` AS `coordinador_id`,`mc`.`nombre` AS `coordinador`,`ms`.`id` AS `movimiento_sueldo_id`,`ms`.`sueldo_imss` AS `sueldo_imss`,`ms`.`sueldo_alternativo` AS `sueldo_alternativo`,`ms`.`sueldo_asimilado` AS `sueldo_asimilado`,`ms`.`sueldo_imss_bruto` AS `sueldo_imss_bruto`,`ms`.`sueldo_alternativo_bruto` AS `sueldo_alternativo_bruto`,`ms`.`sueldo_imss` + `ms`.`sueldo_asimilado` AS `sueldo_mensual_neto`,`ms`.`sueldo_mensual` AS `sueldo_neto`,`mpu`.`id` AS `movimiento_puesto_id`,`mpu`.`puesto` AS `id_puesto`,`mpu`.`nombre_puesto` AS `puesto` from (((((`incore`.`empleados` `em` join `incore`.`movimientos_recurso` `mr` on(`mr`.`id` = (select `incore`.`movimientos_recurso`.`id` from `incore`.`movimientos_recurso` where `incore`.`movimientos_recurso`.`empleado_id` = `em`.`empleado_id` order by `incore`.`movimientos_recurso`.`id` desc limit 0,1))) left join `incore`.`movimientos_proyectos` `mpr` on(`mpr`.`id` = (select `incore`.`movimientos_proyectos`.`id` from `incore`.`movimientos_proyectos` where `incore`.`movimientos_proyectos`.`empleado_id` = `em`.`empleado_id` order by `incore`.`movimientos_proyectos`.`id` desc limit 0,1))) left join (select `m_c`.`id` AS `id`,`m_c`.`coordinador_id` AS `coordinador_id`,`m_c`.`empleado_id` AS `empleado_id`,`m_c`.`fecha_inicio` AS `fecha_inicio`,`m_c`.`fecha_fin` AS `fecha_fin`,`m_c`.`user_log` AS `user_log`,`m_c`.`fecha_log` AS `fecha_log`,`m_c`.`caduca` AS `caduca`,`cc`.`nombre` AS `nombre` from (`incore`.`movimientos_coordinador` `m_c` join `incore`.`catalogo_coordinadores` `cc` on(`cc`.`id` = `m_c`.`coordinador_id`))) `mc` on(`mc`.`id` = (select `incore`.`movimientos_coordinador`.`id` from `incore`.`movimientos_coordinador` where `incore`.`movimientos_coordinador`.`empleado_id` = `em`.`empleado_id` order by `incore`.`movimientos_coordinador`.`id` desc limit 0,1))) left join `incore`.`movimientos_sueldo` `ms` on(`ms`.`id` = (select `incore`.`movimientos_sueldo`.`id` from `incore`.`movimientos_sueldo` where `incore`.`movimientos_sueldo`.`empleado_id` = `em`.`empleado_id` order by `incore`.`movimientos_sueldo`.`id` desc limit 0,1))) left join (select `m_p`.`id` AS `id`,`m_p`.`empleado_id` AS `empleado_id`,`m_p`.`puesto` AS `puesto`,`m_p`.`fecha_inicio` AS `fecha_inicio`,`m_p`.`fecha_fin` AS `fecha_fin`,`m_p`.`user_log` AS `user_log`,`m_p`.`fecha_log` AS `fecha_log`,`m_p`.`observaciones` AS `observaciones`,`c_p`.`nombre_puesto` AS `nombre_puesto` from (`incore`.`movimientos_puestos` `m_p` join `incore`.`catalogo_puesto` `c_p` on(`m_p`.`puesto` = `c_p`.`id`))) `mpu` on(`mpu`.`id` = (select `incore`.`movimientos_puestos`.`id` from `incore`.`movimientos_puestos` where `incore`.`movimientos_puestos`.`empleado_id` = `em`.`empleado_id` order by `incore`.`movimientos_puestos`.`id` desc limit 0,1))) where `em`.`empleado_estatus` = 'ACTIVO';

