CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vista_incidencias` AS (select `i`.`id` AS `id`,`i`.`id_empleado` AS `id_empleado`,concat_ws(' ',`em`.`empleado_nombre`,`em`.`empleado_apaterno`,`em`.`empleado_amaterno`) AS `empleado`,`i`.`id_incidencia_tipo` AS `id_incidencia_tipo`,`ic`.`nombre` AS `nombre`,`i`.`fecha_solicitud` AS `fecha_solicitud`,`i`.`fecha_inicio` AS `fecha_inicio`,`i`.`fecha_fin` AS `fecha_fin`,`i`.`dias` AS `dias`,`i`.`monto` AS `monto`,`i`.`motivo` AS `motivo`,`i`.`id_solicitante` AS `id_solicitante`,`us`.`nombre` AS `solicitante`,`i`.`id_lote` AS `id_lote`,`i`.`auth_rh` AS `auth_rh`,`i`.`id_rh_auth` AS `id_rh_auth`,`us1`.`nombre` AS `rh`,`i`.`auth_direccion` AS `auth_direccion`,`i`.`id_direccion_auth` AS `id_direccion_auth`,`us2`.`nombre` AS `dir`,`i`.`auth_capital` AS `auth_capital`,`i`.`id_capital_auth` AS `id_capital_auth`,`us3`.`nombre` AS `capital`,`i`.`created_at` AS `created_at`,`i`.`updated_at` AS `updated_at`,`i`.`deleted_at` AS `deleted_at`,`i`.`status_auth` AS `status_auth` from ((((((`rh`.`incidencias` `i` left join `rh`.`incidencias_catalogo` `ic` on(`ic`.`id` = `i`.`id_incidencia_tipo`)) left join `incore`.`empleados` `em` on(`em`.`empleado_id` = `i`.`id_empleado`)) left join `incore`.`usuarios` `us` on(`us`.`id_usuario` = `i`.`id_solicitante`)) left join `incore`.`usuarios` `us1` on(`us1`.`id_usuario` = `i`.`id_rh_auth`)) left join `incore`.`usuarios` `us2` on(`us2`.`id_usuario` = `i`.`id_direccion_auth`)) left join `incore`.`usuarios` `us3` on(`us3`.`id_usuario` = `i`.`id_capital_auth`)) where `i`.`download_info` = 0);

