DROP VIEW IF EXISTS `vista_incidencias_periodo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vista_incidencias_periodo` AS (select `i`.`id` AS `id`,`crc`.`capital_id` AS `capital_id`,concat_ws(' ',`e_asign`.`empleado_nombre`,`e_asign`.`empleado_apaterno`,`e_asign`.`empleado_amaterno`) AS `empleado`,`e_asign`.`empleado_num` AS `emp_id`,`cat`.`nombre` AS `incidencia`,`cat`.`tipo` AS `tipo_incidencia`,`cat`.`tratamiento` AS `tratamiento`,`i`.`fecha_solicitud` AS `fecha_solicitud`,`i`.`fecha_inicio` AS `fecha_inicio`,`i`.`fecha_fin` AS `fecha_fin`,`i`.`dias` AS `duracion`,`i`.`monto` AS `monto`,`i`.`motivo` AS `motivo`,`u1`.`nombre` AS `solicitante`,`u1`.`id_usuario` AS `id_solicitante`,`i`.`auth_rh` AS `Autorizado_RH`,`i`.`auth_direccion` AS `Autorizado_DIR`,`i`.`auth_capital` AS `Autorizado_Capital`,`i`.`id_lote` AS `id_lote`,`i`.`download_info` AS `descargado`,`i`.`status_auth` AS `estatus`,`i`.`area_cancelar` AS `cancelado`,`i`.`id_incidencia_tipo` AS `id_tipo`,`i`.`area_solicitante` AS `area_solicitante`,`i`.`vobo` AS `vobo`,`i`.`vobo_final` AS `vobo_final`,`i`.`id_auth_venta` AS `id_auth_venta`,`i`.`auth_venta` AS `auth_venta`,`mc`.`coordinador_id` AS `coordinador_id` from ((((((`rh`.`incidencias` `i` join `rh`.`incidencias_catalogo` `cat` on(`cat`.`id` = `i`.`id_incidencia_tipo`)) left join `incore`.`empleados` `e_asign` on(`e_asign`.`empleado_id` = `i`.`id_empleado`)) left join `incore`.`usuarios` `u1` on(`u1`.`id_usuario` = `i`.`id_solicitante`)) left join (select `m_c`.`id` AS `id`,`m_c`.`coordinador_id` AS `coordinador_id`,`m_c`.`empleado_id` AS `empleado_id`,`m_c`.`fecha_inicio` AS `fecha_inicio`,`m_c`.`fecha_fin` AS `fecha_fin`,`m_c`.`user_log` AS `user_log`,`m_c`.`fecha_log` AS `fecha_log`,`m_c`.`caduca` AS `caduca`,`cc`.`nombre` AS `nombre` from (`incore`.`movimientos_coordinador` `m_c` join `incore`.`catalogo_coordinadores` `cc` on(`cc`.`id` = `m_c`.`coordinador_id`))) `mc` on(`mc`.`id` = (select `incore`.`movimientos_coordinador`.`id` from `incore`.`movimientos_coordinador` where `incore`.`movimientos_coordinador`.`empleado_id` = `e_asign`.`empleado_id` order by `incore`.`movimientos_coordinador`.`id` desc limit 0,1))) left join (select `emp`.`empleado_id` AS `empleado_id`,`emp`.`empleado_nombre` AS `empleado_nombre`,`emp`.`empleado_apaterno` AS `empleado_apaterno`,`crp`.`id` AS `capital_id`,`crh`.`razon_nombre` AS `razon_nombre` from (((`incore`.`empleados` `emp` join `incore`.`movimientos_recurso` `mr` on(`emp`.`empleado_id` = `mr`.`empleado_id`)) join `incore`.`catalogo_razonrh` `crh` on(`crh`.`razon_id` = `mr`.`razon_rh`)) join `rh`.`catalogo_razon_capital` `crp` on(`crh`.`id_razon_capital` = `crp`.`id`)) where `emp`.`empleado_fecha_baja` is null and `mr`.`fecha_baja` is null order by `emp`.`empleado_id`) `crc` on(`crc`.`empleado_id` = `i`.`id_empleado`)) join `rh`.`incidencias_periodos` `ip` on(`i`.`fecha_solicitud` between `ip`.`fecha_inicio` and `ip`.`fecha_envio` and curdate() between `ip`.`fecha_inicio` and `ip`.`fecha_envio`)) where `i`.`status_auth` = 'POR ENVIAR' and `crc`.`capital_id` is not null group by `i`.`id` order by `i`.`id`);

